import React from "react";
import styled from "styled-components";
import Viewer from "./components/Viewer";

function App() {
  return (
    <StyledWrap>
      <StyledTitle>Simple Counter</StyledTitle>
      <Viewer />
    </StyledWrap>
  );
}

export default App;

const StyledWrap = styled.div`
  padding: 0 40px;
`;

const StyledTitle = styled.h1`
  color: black;
`;
